DEBUG - 2025-01-03 10:06:34 --> SELECT `massubcat`.*, `mascat`.`category`
FROM `master_subcategory` as `massubcat`
INNER JOIN `master_category` as `mascat` ON `mascat`.`id` = `massubcat`.`fk_cat_id` AND `mascat`.`category_status` = "Y"
WHERE   (
`massubcat`.`subcategory` LIKE '%%' ESCAPE '!'
OR  DATE_FORMAT(massubcat.created_on, "%d-%m-%Y") LIKE '%%' ESCAPE '!'
 )
AND `subcategory_status` = 'Y'
ORDER BY `massubcat`.`id` DESC
 LIMIT 10
