DEBUG - 2025-01-03 16:45:39 --> SELECT `massubcat`.*, `mascat`.`category`
FROM `master_subcategory` as `massubcat`
INNER JOIN `master_category` as `mascat` ON `mascat`.`id` = `massubcat`.`fk_cat_id` AND `mascat`.`category_status` = "Y"
WHERE   (
